import theBlueStones from "./artistImages/the-blue-stones.png";
import stevieWonder from "./artistImages/stevie-wonder.png";
import chetFaker from "./artistImages/chet-faker.png";
import quakerCityNightHawks from "./artistImages/quaker-city-night-hawks.png";
import hajaj from "./artistImages/hajaj.png";
import warhaus from "./artistImages/warhaus.png";
import tejonStreetCornerThieves from "./artistImages/tejon-street-corner-thieves.png";


const artistData = [
    {
        title: "The Blue Stones",
        image: theBlueStones
    },
    {
        title: "Stevie Wonder",
        image: stevieWonder
    },
    {
        title: "Chet Faker",
        image: chetFaker
    },
    {
        title: "Quaker City Night Hawks",
        image: quakerCityNightHawks 
    },
    {
        title: "Hajaj",
        image: hajaj
    },
    {
        title: "Warhaus",
        image: warhaus
    },
    {
        title: "Tejon Street Corner Thieves",
        image: tejonStreetCornerThieves
    }
];

export default artistData;
